import numpy as np
from sklearn import metrics, preprocessing
from sklearn.metrics import roc_curve, auc, roc_auc_score, accuracy_score
import matplotlib.pyplot as plt

def plotROC(test_labels, pred_score):
    """
    Plots roc curve
    :param pred_labels: List of predicted labels
    :param test_labels: List of true labels
    :return: ROC graph
    """
    roc_auc = roc_auc_score(test_labels, pred_score)
    plt.title('Receiver Operating Characteristic')
    false_positive_rate, true_positive_rate, thresholds = roc_curve(test_labels, pred_score, drop_intermediate=False)
    print(thresholds)
    plt.plot(false_positive_rate, true_positive_rate, color="r", label='AUC* = %0.3f' % roc_auc)
    plt.legend(loc='lower right')
    plt.plot([0, 1], [0, 1], 'k--')
    plt.xlim([-0.1, 1.2])
    plt.ylim([-0.1, 1.2])
    plt.ylabel('True Positive Rate')
    plt.xlabel('False Positive Rate')
    plt.show()


def getANNResults(test_labels, pred_score):
    """
    Get number of maligne and benigne predicted labels
    :param labels: Labels
    :return: maligne, benigne : Number of maligne and benigne prediction
    """
    TP = 0
    TN = 0
    FP = 0
    FN = 0
    for i in range(len(pred_score)):
        pred_label = -1
        if pred_score[i] >= 0.5:
            pred_label = 1
        else:
            pred_label = 0

        if pred_label == test_labels[i] and pred_label ==1:
            TP = TP + 1
        elif pred_label == test_labels[i] and pred_label == 0:
            TN = TN + 1
        elif pred_label != test_labels[i] and pred_label == 1:
            FP = FP +1
        elif pred_label != test_labels[i] and pred_label == 0:
            FN = FN +1

    return TP, TN, FP, FN


